import React, {useState, useEffect} from 'react';
import axios from 'axios';

export default function Home() {
  return <DataFetching />

}

function Headline() {
  const greeting = 'Home Function Component!';
  return <h1>{greeting}</h1>;
}

function DataFetching() {
  const[city, setCity] = useState([])

    useEffect(async () => {
    const result = await axios(
      'http://127.0.0.1:8000/api/citychoice/',
    );
    setCity(result.data);
  }, [])

  return (
      <div>
        <ul>
          {
            city.map(city => <li key={city.id}>{city.title}</li>)
          }
        </ul>
      </div>
  )
}
